		voice_key_2 = -1,
		profile = "I'm the second ship of the King George V-class battleships, the Prince of Wales. I once escorted the Prime Minister to sign the Atlantic Charter. Making my mark in the history books of weaponry? Hmph, how dare you mention that in front of me.",
		mission_complete = "Rewards received! You performed beautifully.",
		headtouch = "",
		feeling2 = "I heard that my current name was chosen because my original one could bring misfortune, but... judging by how things turned out... it seems I'm unable to escape my fate...",
		feeling4 = "Fighting fair and square is my motto. I wish it could be the same when it comes to my own feelings. So... can you stay with me a bit longer? I have something important to tell you, Commander...",
		unlock = "You're the Commander? Very well. I, Prince of Wales, shall let you witness my true strength.",
		battle = "Courage is necessary for success… All ships, fire!",
		login = "Welcome back. Shall we have tea before getting back to work?",
		vote = "",
		detail = "Fate can be easily derailed, Commander.",
