		mission = "Oh, missions? Are there any I can help with?",
		touch2 = "Umm... What are you doing?",
		feeling1 = "A kind deed to others is a kind deed to yourself – or so I was naive enough to believe...",
		skill = "My aim shall not waver!",
		drop_descrip = "King George V-class battleship – Howe (HMS Howe.)",
		mail = "We've received what looks to be mail addressed to you.",
		lose = "Next time... victory will be ours.",
		propose = "Thank you for your sincerity, Commander. I will gladly be yours. I won't ask of you to share all your joys and sorrows with me, as I'm more than happy with just being by your side. Ah, that didn't sound like what I would say, did it? Well, hehehe~",
		hp_warning = "I can't... falter now!",
		id = 205090,
