		feeling1 = "",
		skill = "",
		drop_descrip = "It may be presumptuous of me, but please take care of me from now on... Is that acceptable? S-Somehow, it feels a little embarrassing... Ahaha...",
		mail = "My familiars helped bring the mail in. Ehehe, they seem to have taken a liking to you.",
		lose = "",
		propose = "",
		hp_warning = "",
		id = 305058,
		voice_key = 0,
		feeling5 = "My name is Nagato. Not the Nagato of the Sakura Empire, but of you only. Because you were the one who reached out to me and pulled me from the depths of my loneliness, I wish to always stay by your side. You... won't reject me, right?",
		main = "I shall fight on! At long last I have discovered, what it is that I fight for! |I shall never forget... the warmth of the hands that pulled me out from the shackles of my armaments... |What will the future hold in store...? For the first time in my life, I want to know the answer.",
