	[305060] = {
		touch = "Ahahaha~! That tickles, Commander~! Ahahaha~",
		feeling3 = "I know some things you're happier if you don't know about, but... I still want to know! Besides, aren't there lots of things you're happier if you do know about them?",
		upgrade = "I'll give it all I've got!",
		expedition = "Commander, some people just came back to the port!",
		win_mvp = "Commander, look! I saw a really pretty fish just now! What kind of fish was it?",
		home = "Hold still, Commander! I'm gonna perform an exorcism on you!",
		mission = "Commander, what's this mission about? ... What about this one?",
		touch2 = "Commander, why are you touching me? What's the meaning behind it?",
		feeling1 = "Commander... Just, why?",
		skill = "Mr. Kitty, hang on tight! I'm gonna get serious!",
		drop_descrip = "Nagato-class battleship number two – Mutsu.",
		mail = "This must be \"mail\"... I'll write a \"mail\" to you, so send me a \"reply\" later!",
		lose = "Commander, it feels like my third turret's gonna...",
		propose = "So this means we'll be together as one? That's amazing! It really does feel like I'm together with you when I look at this ring! Why's that?",
		hp_warning = "I want to protect my friends!",
		id = 305060,
		voice_key = 30506,
		feeling5 = "What I wanted to ask was... umm... do you like me? Are my questions annoying? And... Oh, right! I wanted to say that I love you, and I love all the friends I've made here!",
		main = "Why do we need to write like this? Is it wrong to do it this way? Why?|I saw something interesting outside! Can I go check it out?|I wonder where those ants are heading... I wanna find out!",
		voice_key_2 = -1,
		profile = "I'm Mutsu, second ship of the Nagato class! Nagato and I used to swap back and forth between being the Combined Fleet's flagship! Later on, Yamato took on the role, though! Isn't it amazing how much there is to see in the world~? My third turret? Uh... I think it'll be okay this time.",
		mission_complete = "Commander? I put the mission rewards on my turret and brought them here! But don't wake up Mr. Kitty!",
		headtouch = "",
		feeling2 = "Ever since Nagato and I were at Hashira Island, I've wondered... Why is the sky blue? Why can birds fly? Why do we fight? ... There are so many things I wonder...",
		feeling4 = "Commander, can we play? Umm, if you've got work to do, I can come back later. I have so much to ask, and also so, sooo much I wanna tell you!",
		unlock = "Hello, I'm Mutsu! Nagato's little sister! Um, are you a commander? Why? How do you become a commander? Is it cool to be one? Tell me, I wanna know!",
		battle = "Combined Fleet! Uhh... move out!",
		login = "Oh, hi, Commander! Something I don't understand happened while you were away! Why do... (Mutsu began asking a series of questions.)",
