		feeling1 = "",
		skill = "",
		drop_descrip = "I, battleship Mikasa, from now until eternity, pledge to you my undying love and devotion. May we help each other, encourage each other, and walk side-by-side on the same path. I hope to meet your expectations, as unworthy as I may be.",
		mail = "Hehe♪ These medals and awards... are things I obtained with you by my side. Go ahead, burn the sight into your mind~",
