		id = 305118,
		voice_key = 0,
		feeling5 = "",
		main = "My Commander, don't slack on your studies. If you'd like, I'd be happy to teach you personally.|Tonight's menu... How about I make you naval curry that originates from a port I have an affinity with? Of course, it's simply exquisite.|So those are \"airplanes.\" The true potential of new things are often overlooked for quite some time. Do your best to not do the same.",
