		battle = "Vanquish all evil! Crush the enemy!",
		login = "I can't get used to calling you \"Dear\" or you calling me \"Honey\"... Calling each other by what we already do would be easier? Very well, as long as you're fine with it...",
		vote = "",
		detail = "Well, perfect timing. Hm... It looks like this size should fit you... As the one in charge, you can't neglect stocking up on necessities. Once we're in the middle of battle, even your best clothes can get all torn up in the blink of an eye. Make sure you to get some spares while we're still in the lull of peace.",
