	[306080] = {
		touch = "Who?! ... Oh, it's you. I thought it was a prank from that pink-haired Union girl.",
		feeling3 = "I don't dislike having to pamper Chiyoda... If anything, I might actually find it quite endearing...",
		upgrade = "For the time being, thanks, Commander.",
		expedition = "The commission team has returned safely. What a relief.",
		win_mvp = "I'm glad... that I was able to be a help to everyone else.",
		home = "I'm glad you're safe... I made a protective charm for you, and also one for Chiyoda. Please keep it safely inside your clothes.",
		mission = "Here are some more missions. Isn't it bad to let them pile up like this?",
		touch2 = "Hah?! Wait, no...!",
		feeling1 = "Commander. Get away from Chiyoda. As far as you possibly can.",
		skill = "Attack force, surround them...!",
		drop_descrip = "Zuihou-class aircraft carrier – Chitose.",
		mail = "There's a letter addressed to you. Please check it out.",
		lose = "We're pulling back. Chiyoda, please be safe...",
		propose = "If that's how you feel about me, I'll gladly accept your feelings... I'll pray for your safety every day, and be your refuge from your daily hardships. I hope... you'll come look for me whenever you're feeling troubled, because I want to pamper you like I do with Chiyoda...",
		hp_warning = "This is bad... I hope Chiyoda... is alright...",
		id = 306080,
		voice_key = 30608,
		feeling5 = "Commander, won't you rely on me some more? I'm actually pretty good at spoiling people, you know... Oh I know... would you like me to give you a lap pillow, or something...?",
		main = "Isuzu... is quite a scaredy cat, but she's a good girl. But even that side of her is cute.|Chiyoda always insists on doing my hair this way, so I let her. However, I always feel a bit apologetic for making her do so much...|I'm at least confident in my Kagura dancing skills. If you get the chance, please come and watch.",
		voice_key_2 = -1,
		profile = "Though Chiyoda and I were originally designed as seaplane tenders, during a certain war, we were remodeled into aircraft carriers. Whether it's due to my lack of skill or my inability to oppose the passing of time... I wasn't able to be of much use until the end.",
		mission_complete = "The mission is... complete. That's good.",
		headtouch = "Do you like touching my bangs like Chiyoda does?",
		feeling2 = "The one thing I hope I never have to see again is the formation of a \"decoy fleet\"...",
		feeling4 = "Cooking, cleaning, even taking care of my things... Chiyoda takes care of it all. ... Basically, it's not that I can't do these tasks. If I put my mind to it, I can do it... I totally can...",
		unlock = "I am Chitose, light carrier of the Sakura Empire. Commander, I look forward to receiving your guidance. By the way, is it true that Chiyoda is also here? ...Don't worry, I was merely inquiring.",
		battle = "I have to make sure to be careful...",
		login = "Oh, you're here. There's some red bean jelly from Chiyoda on your desk. Feel free to take some.",
		vote = "",
		detail = "Chiyoda and I are partners in carrying out shrine duties. Even though Chiyoda can be pretty annoying at times, there are still times she's fun to be around.",
		couple_encourage = {
			{
				{
					30609
				},
				1,
				"Alright, alright... We'll go together.",
				0
