	[405011] = {
		touch = "A dance...? Oh, no, I wouldn't turn one down, I just haven't been asked until now...",
		feeling3 = "",
		upgrade = "",
		expedition = "Once the commission fleet has finished dropping off their supplies, let's invite them to the banquet as well.",
		win_mvp = "",
		home = "Let us raise our glasses to the heroes who have returned from battle.",
		mission = "Having unfinished work will turn even the finest wine into vinegar. Isn't that right, Commander?",
		touch2 = "C-Commander... don't tease me like that...",
		feeling1 = "",
		skill = "",
		drop_descrip = "My sincerest apologies for the delay, Commander. Ah, excuse me... as the fleet leader of the Iron Blood, I'm expected to wear this outfit to various formal occasions. Just putting it on seems to make me inadvertently change the way I speak...",
		mail = "Even at the most lavish banquet, it is your responsibility as commander to be well-informed should the situation change.",
		lose = "",
		propose = "",
		hp_warning = "",
		id = 405011,
		voice_key = 0,
		feeling5 = "In front of my compatriots, I always had to be adamant, solemnly spearheading the march of the Iron Blood. To be the leader of the Iron Blood's indomitable fleet, I had to lock away the Bismarck that struggled to express herself... But when I'm with you, Commander, I can set aside that burden, just for a little bit...",
		main = "Commander, would you invite Tirpitz for me? Apologies, I'm... still not sure how to ask her myself. |I can keep a lot of people satisfied merely by sitting here with a smile... but only because of my status as the fleet leader of the Iron Blood. |As a leader, I must sometimes say and do things that I do not believe in. Commander, I hope you never lose sight of who you are.",
