		mission_complete = "A decoration for the banquet? Splendid work.",
		headtouch = "",
		feeling2 = "",
		feeling4 = "",
		unlock = "My sincerest apologies for the delay, Commander. Ah, excuse me... as the fleet leader of the Iron Blood, I'm expected to wear this outfit to various formal occasions. Just putting it on seems to make me inadvertently change the way I speak...",
		battle = "",
		login = "How's your work coming along, Commander?",
		vote = "",
