		touch2 = "Your spirited enthusiasm... You might want to change the way you convey it.",
		feeling1 = "Commander, I've got one word of advice for you. If your condition isn't great, make sure to take a break and sleep soundly. It won't do to have everyone else see you in bad shape.",
		skill = "The time has come!",
		drop_descrip = "Aircraft carrier – Weser. ",
		mail = "There's some mail for you. If it's nothing urgent, just read them later.",
		lose = "Ugh... I wonder if I'm still not used to my planes...",
		propose = "This ceremony... Surely you didn't have to be in such a rush? It's not like I'll run off somewhere or forget our promises together. Or... is it that you don't have any faith in me? Hehe, I'm just messing with you. For the future everlasting, I'll be yours, Commander.",
