		id = 406010,
		voice_key = 40601,
		feeling5 = "Have you matched your stride to my tempo, or have I matched mine to meet yours? Putting all that aside, you know, having you by my side makes me feel comfortable and relaxed. Hehe.",
		main = "The Iron Blood doesn't have as many aircraft carriers as the other factions, so I can't help but worry that we'll be at a disadvantage during practice exercises.|The Unsinkable Battleship...? Oh, I know who you're talking about. I wonder if I'll ever be able to meet my renowned predecessor, Seydlitz, at some point?|Hipper, Eugen... I can't believe I'm able to fight by their side like this. It's all thanks to you, Commander.",
		voice_key_2 = -1,
		profile = "Whether as the 4th ship of the Admiral Hipper class, Seydlitz, or as the escort carrier, Weser, I was never completed over the entirety of that war. ...Over here, I should have more than enough time to do everything I've always wanted to do. That way, I'll be able to bury my regrets, one by one.",
		mission_complete = "Mission complete. Don't worry, it's not like the rewards will run off somewhere. You just need to make sure to collect them later.",
		headtouch = "",
		feeling2 = "The battlefield is a place where the unexpected occurs. If you simply insist on following the orders given to you by the higher-ups, you'll never be able to achieve victory.",
		feeling4 = "I believe that the way we live isn't influenced by our environment, but rather the choices we've made. That's why I've always lived by my own tempo. What do you think about the way I live my life?",
		unlock = "Heavy cruiser, Seydlitz... Rather, escort carrier Weser, has arrived. You're wondering why I have two names? Don't be in such a rush... I'll be sure to teach you later, slowly.",
		battle = "Keep calm and persevere. Victory will surely come to us.",
		login = "Before you hurry off to do your work, why not first take a seat and enjoy a cup of coffee?",
		vote = "",
