		main = "Now, who will be the lucky recipient of Littorio's rose this time? Oh, but of course, Commander. If you want it, maybe you'll get it?|There are two kinds of parties in the world: those with Littorio in attendance, and those without.|I personally picked out all the various furnishings in here. It is no exaggeration to call this suite \"La Littorio\" itself. How do you like the sound of that, Commander?",
