		touch2 = "Just how little do you think of me?",
		feeling1 = "You will eventually pay the price for your arrogance.",
		skill = "This volley... shall not be my last! ",
		drop_descrip = "Conte di Cavour-class battleship – Conte di Cavour. ",
		mail = "New mail has arrived... I'm not your butler, and you're perfectly capable of getting it yourself. Look, it's by your right hand.",
		lose = "Ngh... Must I also bow my head to the passage of time...?",
		propose = "You're giving such an important thing to me...? I... this is... ahh! I'm sorry, I can't keep my composure, but I'll try my best to say it... \"I do!\" How's that? P-please let this embarrassing ritual be over already...",
