		id = 605050,
		voice_key = 60505,
		feeling5 = "I said \"let's look ahead,\" right? In that case, I'll cover your back. That way, no matter what happens, you can always keep your eyes ahead of you and leave the rest to me.",
		main = "A gown? I have no interest in things like that. Nor will I ever. |Commander, if I ever get invited to one of those Royal tea parties, please tell them that I am too busy with secretary work. |Some people used to hold me to lofty expectations, but it feels natural to see the next generation surpass me.",
		voice_key_2 = -1,
		profile = "I witnessed the ascendancy of the Imperial Fleet as well as its decay into powerlessness. Commander, I pray that you, as the leader of the fleet, will never repeat the tragedies of the past.",
		mission_complete = "One more name off my list... Oh, I was talking about the list of unfinished missions.",
		headtouch = "",
		feeling2 = "As one of Sardegna's veterans, I have ample experience ranging from communication to fleet management. If you need any advice, feel free to ask me.",
		feeling4 = "Long live the glory of the Sardegna Empire... Forget it, it's all in the past now. I'm getting used to being in this fleet, so let's look ahead.",
		unlock = "I am the dreadnought, Conte di Cavour. There is much that I can do for you, Commander, but that depends on whether or not you are trustworthy.",
		battle = "It is time to clad yourselves in courage and wisdom!",
