		headtouch = "",
		feeling2 = "Comrade Commander, if you want people to like you, you've gotta be an interesting person yourself! In other words, what you need is a dose of inspiration!",
		feeling4 = "Comrade Commander, I thought you were a real hardass, but turns out, you're actually quite interesting! You have quite a lot of ideas of your own... and you don't ",
