		mission_complete = "That should wrap things up! You did pretty well!",
		headtouch = "Are you seriously giving me the kiddie treatment? Hmph!",
		feeling2 = "Are you looking forward to my idol debut? Is that so... Well, considering this is an armament test and whatnot, I guess I can put in a little effort.",
