	[702040] = {
		touch = "Lead the way, Comrade Commander.",
		feeling3 = "Splendid, Comrade Commander. You've chosen a path of your own. Now follow it and see where it takes you!",
		upgrade = "This strength will further our cause!",
		expedition = "A commission has been completed. We must head out and greet the returnees. Our comrades deserve recognition for their efforts.",
		win_mvp = "Our advance will stop for nothing and nobody!",
		home = "Well fought, Comrade Commander! Your valor warrants the front page spot in the port's newspaper!",
		mission = "It is time to embark on a mission, Comrade Commander.",
		touch2 = "This is no time for this sort of depravity, Comrade Commander.",
		feeling1 = "It pains me to say, but I no longer consider you my comrade.",
		skill = "Hear me! I am Kirov!",
		drop_descrip = "Kirov-Class cruiser—Kirov",
		mail = "You have mail. Read it through at once. The more comrades, the better. Always.",
		lose = "Gah...! I cannot and will not succumb until our ambitions have been realized!",
		propose = "Only a fool chooses between protecting either the world or their lover. There is but one correct answer: protecting them both. We have both the will and the means to do just that. Come, Comrade Commander, let us march onwards!",
		hp_warning = "No! I am far, far from finished!",
		id = 702040,
		voice_key = 70204,
		feeling5 = "To fight not just for your motherland but also for your soulmate, that is what love is... I understand it now. Passion is the fuel of my fighting spirit. And as long as I have you, nothing is impossible!",
		main = "The strong must always march onward. Holding the line is what the weak do.|Glory is what sustains and strengthens us, and is what will leave our mark on history.|I march onward in the name of a tomorrow where everyone is safe and smiling.",
		voice_key_2 = -1,
		profile = "Salutations, Comrade Commander. I am Kirov. My appearance, rigging, and class are all unimportant in the greater scheme of our ambitions. What matters is that we work together to achieve a future of red glory.",
		mission_complete = "I knew you would pull through for us, Comrade Commander! Here are the rewards.",
		headtouch = "",
		feeling2 = "Never let but's or if's misguide you, Comrade Commander. You alone decide what is right and true.",
		feeling4 = "I will always watch over you. Should you ever lose your way, I will be the hand that shoves you back on the right path. Only look ahead, never stop advancing!",
		unlock = "I am the child of a union between our unprecedented country and a free spirit! Now, Comrade Commander, let us achieve great things together!",
		battle = "To arms, comrades!",
		login = "Good to see you again, Comrade Commander! Let us once more set out to teach our enemy the meaning of unity and solidarity.",
		vote = "",
		detail = "Neither fate nor evil can hamper our ambitions!",
		couple_encourage = {
			{
				{
					7
				},
				2,
				"Onwards, Northern Parliament comrades!",
				3
			},
			{
				{
					70301
				},
				1,
				"I have your back,Tallinn!",
				0
			},
			{
				{
					31201,
					20501
				},
				2,
				"You may be bourgeois swine... but today, we fight together!",
				0
			}
		}
	},
