		voice_key_2 = -1,
		profile = "I am Richelieu, the lead ship of the Richelieu class. During my history as a ship, I lived through good times and bad times, and I also witnessed the rise and fall of my homeland... This time, I hope to protect all that is dear to me up until the end. Together with this fleet, I strive for liberty and peace...",
